import React from 'react';
import { Form, FormGroup, Label, Input, Button } from 'reactstrap';

const Signup = () => {
  return (
    <div className='signup-form-div'>
      <Form>
        <FormGroup>
          <Label for='username'>
            <Input 
              autoFocus 
              type='text'
              name='username'
              id='username'
              // value={formData.username}
              // onChange={handleLoginChange}  
            />
          </Label>
        </FormGroup>

        <FormGroup>
          <Label for='password'>
            <Input 
              type='password'
              name='password'
              id='password'
              // value={formData.username}
              // onChange={handleLoginChange}  
            />
          </Label>
        </FormGroup>

        <FormGroup>
          <Label for='firstName'>
            <Input  
              type='text'
              name='firstName'
              id='firstName'
              // value={formData.username}
              // onChange={handleLoginChange}  
            />
          </Label>
        </FormGroup>

        <FormGroup>
          <Label for='lastName'>
            <Input 
              type='text'
              name='lastName'
              id='lastName'
              // value={formData.username}
              // onChange={handleLoginChange}  
            />
          </Label>
        </FormGroup>

        <FormGroup>
          <Label for='username'>
            <Input 
              type='text'
              name='username'
              id='username'
              // value={formData.username}
              // onChange={handleLoginChange}  
            />
          </Label>
        </FormGroup>
      </Form>
    </div>  
  );  
}

export default Signup;
